import React from "react";
import { connect } from "react-redux";
import ReactDatetime from "react-datetime";
import { getCurrentExpert, updateCurrentExpert, getExpertScheduale, updateExpertScheduale } from "actions/userActions";
import SwiperCore, { Navigation, Pagination, Scrollbar, A11y, EffectCoverflow } from 'swiper';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.scss';
import {
  Button,
  Modal,
  ModalBody,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  FormGroup,
  Input,
  Row,
  Col,
  Container,
  Table, InputGroup, InputGroupAddon, InputGroupText
} from "reactstrap";
import NotificationAlert from "react-notification-alert";
import bg from "assets/img/flower-back.png";
import 'swiper/components/effect-coverflow/effect-coverflow.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/pagination/pagination.scss';
SwiperCore.use([EffectCoverflow]);
SwiperCore.use([Navigation, Pagination, Scrollbar, A11y]);

class Settings extends React.Component {
  notify = place => {
    var options = {};
    options = {
      place: place,
      message: (
        <div>
          <div>
            Profile successfuly updated.
          </div>
        </div>
      ),
      type: 'success',
      icon: "tim-icons icon-bell-55",
      autoDismiss: 7
    };
    this.refs.notificationAlert.notificationAlert(options);
  };

  constructor(props) {
    super(props);
    this.state = {
      modalBank: false,
      modalPersonalDetails: false,
      modalPhotoGallery: false,
      modalAvailability: false,
      modalNotification: false,
      about: '',
      status: false,
        rowKey: null,
        isEdit: false,
      scheduale: {
        availability: []
      },
      userProfile: {
        residential: {}
      },
    };
  }
  onEdit = (id) => {

    this.setState({
        status: true,
        rowKey: id
    })
}
onCancel = () => {
  const user = {
    expert_id: "5f89b74c785a191b10dab1ac",
    role: 'expert'
  };
  this.props.getExpertScheduale(user);
  this.setState({
      status: false,
      rowKey: null
  })
}
onSave = () => {
  const user = {
    scheduale: this.state.scheduale
  };
  this.props.updateExpertScheduale(user);
  this.setState({
    status: false,
    rowKey: null
})
}
  componentDidMount() {
    const user = {
      expert_id: "5f89b74c785a191b10dab1ac",
      role: 'expert'
    };
    this.props.getCurrentExpert(user);
    this.props.getExpertScheduale(user);
  }
  toggleModalBank = () => {
    this.setState({
      modalBank: !this.state.modalBank
    });
  };
  toggleModalGallery = () => {
    this.setState({
      modalPhotoGallery: !this.state.modalPhotoGallery
    });
  };
  togglePersonalDetails = () => {
    this.setState({
      modalPersonalDetails: !this.state.modalPersonalDetails
    });
  };
  toggleAvailability = () => {
    this.setState({
      modalAvailability: !this.state.modalAvailability
    });
  };
  handleProfileUpdate = () => {
    const current = {
      currentUser: this.state.userProfile
    };
    this.props.updateCurrentExpert(current);
    this.togglePersonalDetails();
    this.notify("br");
  }
  handleFromChange = (event) => {

    let items = [...this.state.scheduale.availability];
    let item = items.find(x => x._id === this.state.rowKey);
    item.from = event.target.value;
     this.setState({
      data: items.map(el => (el._id === item._id ? {...el, item} : el))
     }
     ); }
    handleToChange = (event) => {

    let items = [...this.state.scheduale.availability];
    let item = items.find(x => x._id === this.state.rowKey);
    item.to = event.target.value;
      this.setState({
      data: items.map(el => (el._id === item._id ? {...el, item} : el))
      }
      ); }
    handleStatusChange = (event) => {

      let items = [...this.state.scheduale.availability];
      let item = items.find(x => x._id === this.state.rowKey);
      item.status = event.target.value;
        this.setState({
        data: items.map(el => (el._id === item._id ? {...el, item} : el))
        }
        ); }
  onChange = e => {
    let obj = this.state.userProfile;
    obj[e.target.id] = e.target.value;
    this.setState({ userProfile: obj })
  };
  onChangeResidential = e => {
    let obj = this.state.userProfile;
    obj.residential[e.target.id] = e.target.value;
    this.setState({ userProfile: obj })
  };
  onChangeVenue = e => {
    let obj = this.state.userProfile;
    obj.venue[e.target.id] = e.target.value;
    this.setState({ userProfile: obj })
  };
  componentWillReceiveProps(nextProps) {
    this.setState({
      userProfile: nextProps.user.payload,
      scheduale: nextProps.user.scheduale
    })
  };

  render() {
    return (
      <>

        <div className="content"
          style={{
            backgroundImage: `url(${bg})`,
            backgroundPosition: "right top",
            backgroundRepeat: "no-repeat",
          }}
        >
          <div className="react-notification-alert-container">
            <NotificationAlert ref="notificationAlert" />
          </div>
          <Container>
            <Row>
              <Col lg="3" />
              <Col lg="3">
                <Card className="card-settings" style={{
                  textAlign: "center",
                }} onClick={this.togglePersonalDetails}>
                  <CardHeader >
                    <CardTitle>
                      Personal Details
                                    </CardTitle>
                  </CardHeader>
                  <CardBody >
                    <img
                      alt="..."
                      src={require("assets/img/icon_salon_chair.png")}
                    />
                  </CardBody>
                </Card>
              </Col>
              <Col lg="3">
                <Card className="card-settings" style={{
                  textAlign: "center"
                }} onClick={this.toggleModalBank}>
                  <CardHeader>
                    <CardTitle >
                      Bank Details
                                    </CardTitle>
                  </CardHeader>
                  <CardBody >
                    <img
                      alt="..."
                      src={require("assets/img/icon_wallet.png")}
                    />
                  </CardBody>
                </Card>
              </Col>
            </Row>
            <Row>
              <Col lg="3" />
              <Col lg="3">
                <Card className="card-settings" style={{
                  textAlign: "center"
                }} onClick={this.toggleAvailability}>
                  <CardHeader >
                    <CardTitle>
                      Availability
                                    </CardTitle>
                  </CardHeader>
                  <CardBody >
                    <img
                      alt="..."
                      src={require("assets/img/icon_availability.png")}
                    />
                  </CardBody>
                </Card>
              </Col>
              <Col lg="3">
                <Card className="card-settings" style={{
                  textAlign: "center"
                }} onClick={this.toggleModalGallery}>
                  <CardHeader>
                    <CardTitle>
                      Photo Gallery
                                    </CardTitle>
                  </CardHeader>
                  <CardBody>
                    <img
                      alt="..."
                      src={require("assets/img/icon_photo.png")}
                    />
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </Container>
          <Modal
            modalClassName="modal-services"
            isOpen={this.state.modalBank}
            toggle={this.toggleModalBank}>
            <div className="modal-header justify-content-center">
              <button
                aria-label="Close"
                className="close"
                data-dismiss="modal"
                type="button"
                onClick={this.toggleModalBank}
              >
                <i className="tim-icons icon-simple-remove" />
              </button>
              <h4 className="title title-up">Bank Details</h4>
            </div>
            <ModalBody >
              <div className="content">
                <Row>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Expert ID</label>
                      <Input
                        disabled
                        defaultValue="120"
                        type="number"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pl-md-1" md="6">
                    <FormGroup>
                      <label>Full Name</label>
                      <Input
                        defaultValue="Adam Schwerbatsky"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>IBAN number</label>
                      <Input
                        defaultValue="EEXX-XXXX-XXXX-1290"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pl-md-1" md="6">
                    <FormGroup>
                      <label>Account number</label>
                      <Input
                        defaultValue="EEXX-XXXX-XXXX-1290"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Account number</label>
                      <Input
                        defaultValue="Swedish Hepsta Bank LLC"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pl-md-1" md="6">
                    <FormGroup>
                      <label>Bank Address</label>
                      <Input
                        defaultValue="Hepstada St. 112, 14052, Tallinn, Estonia"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Swift Code</label>
                      <Input
                        defaultValue="LOAA12E"
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col>
                    <Button className="btn-block"
                      color="success"
                      type="button"
                    >
                      Save
                  </Button>
                  </Col>
                </Row>
              </div>
            </ModalBody>
          </Modal>
          <Modal
            modalClassName="modal-services"
            isOpen={this.state.modalPersonalDetails}
            toggle={this.togglePersonalDetails}>
            <div className="modal-header justify-content-center">
              <button
                aria-label="Close"
                className="close"
                data-dismiss="modal"
                type="button"
                onClick={this.togglePersonalDetails}
              >
                <i className="tim-icons icon-simple-remove" />
              </button>

            </div>
            <ModalBody >
              <div className="content">
                <Row>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>First Name</label>
                      <Input
                        id="firstName"
                        value={this.state.userProfile.firstName || ''}
                        type="text"
                        onChange={this.onChange}
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pl-md-1" md="6">
                    <FormGroup>
                      <label>Second Name</label>
                      <Input
                        id="lastName"
                        value={this.state.userProfile.lastName || ''}
                        onChange={this.onChange}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Phone</label>
                      <Input
                        id="phoneNumber"
                        value={this.state.userProfile.phoneNumber || ''}
                        onChange={this.onChange}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Email</label>
                      <Input
                        id="email"
                        value={this.state.userProfile.email || ''}
                        onChange={this.onChange}
                        type="email"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Gender</label>
                      <Input
                        data-trigger=""
                        id="choices-single-default"
                        name="choices-single-default"
                        type="select"
                      >
                        <option placeholder="true">Male</option>
                        <option defaultValue="2">Female</option>
                        <option defaultValue="3">Others</option>
                      </Input>
                    </FormGroup>

                  </Col>
                  <Col className="pr-md-1">
                    <FormGroup>
                      <label>Date of Birth</label>
                      <ReactDatetime
                        inputProps={{
                          placeholder: "Select Date"
                        }}
                        timeFormat={false}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1">
                    <label>Residential Address</label>

                  </Col>
                </Row>
                <Row>
                  <Col className="pr-md-1" md="8">
                    <FormGroup>
                      <label>Street</label>
                      <Input
                        id="street"
                        onChange={this.onChangeResidential}
                        value={this.state.userProfile.residential.street || ''}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="2">
                    <FormGroup>
                      <label>No</label>
                      <Input
                        type="text"
                        value={this.state.userProfile.residential.number || ''}
                        onChange={this.onChangeResidential}
                        id="number"
                      />
                    </FormGroup>
                  </Col>

                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>City</label>
                      <Input
                        value={this.state.userProfile.residential.city || ''}
                        type="text"
                        onChange={this.onChangeResidential}
                        id="city"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>PC</label>
                      <Input
                        type="text"
                      />
                    </FormGroup>
                  </Col>

                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1">
                    <label>Venue Address</label>
                  </Col>
                </Row>
                <Row>
                  <Col className="pr-md-1" md="4">
                    <FormGroup>
                      <label>Street</label>
                      <Input
                        id="street"
                        onChange={this.onChangeVenue}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="2">
                    <FormGroup>
                      <label>No</label>
                      <Input
                        id="number"
                        onChange={this.onChangeVenue}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Venue Name (optional)</label>
                      <Input
                        type="text"
                        id="venueName"
                        onChange={this.onChange}
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>City</label>
                      <Input
                        id="city"
                        onChange={this.onChangeVenue}
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>PC</label>
                      <Input
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="12">
                    <FormGroup>
                      <label>About myself</label>
                      <Input
                        id="about"
                        value={this.state.userProfile.about || ''}
                        onChange={this.onChange}
                        type="text"
                        placeholder="Write something about yourself which will be visible to public"
                        type="textarea"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col className="pr-md-1" md="6">
                    <FormGroup>
                      <label>Change Password</label>
                      <Input
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                  <Col className="pl-md-1" md="6">
                    <FormGroup>
                      <label>Confirm Password</label>
                      <Input
                        type="text"
                      />
                    </FormGroup>
                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col>
                    <Button className="btn-block"
                      color="success"
                      type="button"
                      onClick={() => {
                        this.handleProfileUpdate();
                      }}
                    >
                      Save
                  </Button>
                  </Col>
                </Row>
              </div>
            </ModalBody>
          </Modal>
          <Modal
            modalClassName="modal-services"
            isOpen={this.state.modalPhotoGallery}
            toggle={this.toggleModalGallery}>
            <div className="modal-header justify-content-center">
              <button
                aria-label="Close"
                className="close"
                data-dismiss="modal"
                type="button"
                onClick={this.toggleModalGallery}
              >
                <i className="tim-icons icon-simple-remove" />
              </button>
              <h4 className="title title-up">Photo Gallery</h4>
            </div>
            <ModalBody >
              <div className="content">
                <Row className="justify-content-center">
                <input type="file" onChange={this.onImageChange} className="filetype" id="group_image"/>
                  <img
                    className="rounded-circle"
                    alt="..."
                    style={{
                      height: '100px',
                      width: '100px'
                    }}
                    src={require("assets/img/upload_button.png")}
                  />
                </Row>
                <Row style={{ marginTop: "30px" }} className="justify-content-center">
                  Upload Image(s)
           </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Col>
                    <Swiper
                      effect='coverflow'
                      pagination={{ clickable: true }}
                      slidesPerView={3}
                      spaceBetween={10}
                      grabCursor='true'
                      coverflow={{
                        rotate: 50,
                        stretch: 0,
                        depth: 100,
                        modifier: 1,
                        slidesShadows: true
                      }}
                      onSlideChange={() => console.log('slide change')}
                    >
                      <SwiperSlide>  <img
                        alt="..."
                        src={require("assets/img/slider1.jpg")}
                      /></SwiperSlide>
                      <SwiperSlide>  <img
                        alt="..."
                        src={require("assets/img/slider1.jpg")}
                      /></SwiperSlide>
                      <SwiperSlide>  <img
                        alt="..."
                        src={require("assets/img/slider1.jpg")}
                      /></SwiperSlide>
                      <SwiperSlide>  <img
                        alt="..."
                        src={require("assets/img/slider1.jpg")}
                      /></SwiperSlide>
                    </Swiper>

                  </Col>
                </Row>
                <Row style={{ marginTop: "30px" }}>
                  <Button className="btn-block"
                    color="success"
                    type="button"
                  >
                    Save
                  </Button>
                </Row>
              </div>
            </ModalBody>
          </Modal>
          <Modal
